contracts/test1.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.8.21;

contract electiveSystem {
  address public owner;

  bytes32[] public tt;

  constructor() public {
    owner = msg.sender;
  }

  function setTt(bytes32 _a) public {
      tt.push(_a);
  }

  function getTt(bytes32[] memory _ab) pure public returns(bytes32){
      return _ab[0];
  }
}

